@font-face {
    font-family: RobontoCondensed;
    src: url(5d30c80be022ceff40a1f361bb6fa5e7.ttf);
    font-weight: 800;
}
@font-face {
    font-family: EconomicaBold;
    src: url(ceff4cd93c62942004342c163846b11f.ttf);
}

body {
    text-align: center;
    font-size: 20px;
    padding: 3%;
    font-family: RobontoCondensed;
}

h1, h2, h3, h4, h5 {
    font-family: EconomicaBold;
}

.track {
    width: 250px;
    height: 250px;
    position: relative;
    display: inline-block;
    margin: 20px;
    cursor: pointer;
}

.track-image {
    width: 250px;
    height: 250px;
}
.track-text {
    position: absolute;
    width: 250px;
    bottom: 0px;
    background-color: black;
    color: white;
    padding: 5px;
}

.track-icon {
    position: absolute;
    bottom: 100px;
    left: 100px;
    color: white;
    background-color: black;
    width: 50px;
    height: 50px;
    border-radius: 25px;
    padding: 10px;
    opacity: 0.8;


}
